define({"topics" : [{"title":"Origins","shortdesc":"\n               <p class=\"shortdesc\">Edge pipelines support a limited number of origins. </p>\n            ","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelineTypes.html#concept_n2n_r2q_s2b","attributes": {"data-id":"concept_n2n_r2q_s2b",},"menu": {"hasChildren":false,},"tocID":"concept_n2n_r2q_s2b-d46e186283","topics":[]},{"title":"Processors","shortdesc":"\n               <p class=\"shortdesc\">Edge pipelines support a limited number of processors. Processors function the                 same way in edge pipelines\n                  as they do in other pipelines. However, some processors                 have limitations in edge pipelines as noted below.\n               </p>\n            ","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelineTypes.html#concept_ih5_s2q_s2b","attributes": {"data-id":"concept_ih5_s2q_s2b",},"menu": {"hasChildren":false,},"tocID":"concept_ih5_s2q_s2b-d46e186308","topics":[]},{"title":"Destinations","shortdesc":"\n               <p class=\"shortdesc\">Edge pipelines support a limited number of destinations. </p>\n            ","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelineTypes.html#concept_fs1_52q_s2b","attributes": {"data-id":"concept_fs1_52q_s2b",},"menu": {"hasChildren":false,},"tocID":"concept_fs1_52q_s2b-d46e186343","topics":[]},{"title":"Error Record Handling","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelineTypes.html#concept_anm_21f_pbb","attributes": {"data-id":"concept_anm_21f_pbb",},"menu": {"hasChildren":false,},"tocID":"concept_anm_21f_pbb-d46e186388","topics":[]},{"title":"Data Formats","shortdesc":"\n               <p class=\"shortdesc\">Stages included in edge pipelines can process a limited number of data         formats.</p>\n            ","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelineTypes.html#concept_i32_2vf_pbb","attributes": {"data-id":"concept_i32_2vf_pbb",},"menu": {"hasChildren":false,},"tocID":"concept_i32_2vf_pbb-d46e186440","topics":[]},{"title":"Edge Pipeline Limitations","shortdesc":"\n               <p class=\"shortdesc\">Edge pipelines run on <span class=\"ph\">SDC Edge</span> which         is a lightweight agent without a UI. As a result, some features available for standalone         pipelines\n                  are not available for edge pipelines at this time. We will provide support for         some of these features in edge pipelines\n                  in a future release.\n               </p>\n            ","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelineTypes.html#concept_pbm_q4r_4bb","attributes": {"data-id":"concept_pbm_q4r_4bb",},"menu": {"hasChildren":false,},"tocID":"concept_pbm_q4r_4bb-d46e186506","topics":[]}]});